    total_examinations = sum(values)
    if total_examinations <= k:
        return -1
    l = 0
    r = k + 1
    while r - l > 1:
        m = (r + l) // 2
        cnt = 0
        for i in range(n):
            cnt += min(values[i], m)
        if cnt > k:
            r = m
        else:
            l = m
